import './Navigation.css';
import './Body.css'
import { Routes, Route } from "react-router-dom"
import Media1 from './Media1';
import Login from './Login';
import Body from './Body';
import About from './About';
import Event1 from './Event1';
import { render } from '@testing-library/react';

function Navigation(){
  return(
    <><div className='box'>
      <div className='logo'>LOGO</div>
      <div className='nav'>
      <Routes>
      <ul>
          <li><a href="#home"id='col' >Home <Route path="/" element={ <Body/> } /></a></li>
          <li><a href="#event"id='col'>Event <Route path="Event" element={ <Event1/> } /></a></li>
          <li><a href="media"id='col'>Media  <Route path="Media" element={ <Media1/> } /></a></li>
          <li><a href="#about us"id='col'>About us <Route path="about" element={ <About/> } /></a></li>
          <div className='button nav'id='col'><a href="<Login/>"id='col'>Log in <Route path="Login" element={ <Login/> } /></a></div>
        </ul>
      </Routes>
      </div>
    </div>

      </> 
        
  );
}      export default Navigation;
